// src/AdminEntries.js
import React, { useState, useEffect } from 'react';
import './AdminEntries.css';

function AdminEntries({ userId }) {
  const [entries, setEntries] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  
  // Yeni giriş ekleme form state'i: sadece arac_plaka bilgisi
  const [newEntry, setNewEntry] = useState({
    arac_plaka: ''
  });

  // Giriş kayıtlarını çekmek için fonksiyon
  const fetchEntries = async () => {
    try {
      const res = await fetch('/api/giris'); // Proxy kullanıyorsanız bu yeterli
      // Eğer proxy yoksa: fetch('http://localhost:5000/api/giris')
      const data = await res.json();
      setEntries(data);
      setLoading(false);
    } catch (err) {
      console.error("Giriş kayıtları çekilirken hata:", err);
      setError("Giriş kayıtları çekilirken bir hata oluştu.");
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchEntries();
  }, []);

  // Yeni giriş ekleme işlemi
  const handleAddEntry = async (e) => {
    e.preventDefault();
    setError('');
    if (!newEntry.arac_plaka.trim()) {
      setError('Lütfen araç plakasını giriniz.');
      return;
    }
    try {
      // POST isteğinde, calisan_ID userId prop'dan alınır
      const response = await fetch('/api/giris', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          arac_plaka: newEntry.arac_plaka.trim(),
          calisan_ID: userId
        })
      });
      if (!response.ok) {
        const errData = await response.json();
        setError(errData.error || "Giriş kaydı eklenemedi.");
        return;
      }
      setNewEntry({ arac_plaka: '' });
      fetchEntries();
    } catch (err) {
      console.error("Giriş eklenirken hata:", err);
      setError("Giriş eklenirken bir hata oluştu.");
    }
  };

  return (
    <div className="admin-entries-container">
      <h2>Girişler Yönetimi</h2>
      
      {/* Yeni Giriş Ekleme Formu */}
      <form className="add-entry-form" onSubmit={handleAddEntry}>
        <h3>Yeni Giriş Kaydı Ekle</h3>
        {error && <div className="error">{error}</div>}
        <div className="form-row">
          <label>Araç Plaka:</label>
          <input
            type="text"
            value={newEntry.arac_plaka}
            onChange={(e) => setNewEntry({ arac_plaka: e.target.value })}
            required
          />
        </div>
        <button type="submit">Giriş Kaydı Ekle</button>
      </form>
      
      {/* Giriş Kayıtları Tablosu */}
      {loading ? (
        <div>Yükleniyor...</div>
      ) : (
        <table className="entries-table">
          <thead>
            <tr>
              <th>Giriş ID</th>
              <th>Araç Plaka</th>
              <th>Giriş Saati</th>
              <th>Çıkış Durumu</th>
            </tr>
          </thead>
          <tbody>
            {entries.length > 0 ? (
              entries.map((entry) => (
                <tr key={entry.giris_ID}>
                  <td>{entry.giris_ID}</td>
                  <td>{entry.arac_plaka}</td>
                  <td>{new Date(entry.giris_saat).toLocaleString()}</td>
                  <td>{entry.cikis_durumu}</td>
                </tr>
              ))
            ) : (
              <tr>
                <td colSpan="4">Giriş kaydı bulunamadı.</td>
              </tr>
            )}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default AdminEntries;
